import React, {useState} from "react";
import {BrowserRouter} from "react-router-dom";
import {Button, Input, Card, Table, PageHeader} from "antd";
import BraftEditor from "braft-editor"; // 引入富文本编辑器
import "braft-editor/dist/index.css"; // 引入css样式

const Case = function () {
    const [isAdd, setIsAdd] = useState(false); // 记录是否是添加页面

    const columns = []

    const casePage = () => { // 显示案例
        return (
            <div>
                <Input.Group compact>
                    <Input style={{width: "200px"}} placeholder={"请输入案例名称"}/>&nbsp;&nbsp;&nbsp;
                    <Button type={"primary"}>搜索</Button>&nbsp;&nbsp;&nbsp;
                    <Button type={"primary"} onClick={() => {
                        setIsAdd(true);
                    }}>添加</Button>
                </Input.Group>
                <Table style={{marginTop: "20px"}}></Table>
            </div>
        )
    }

    const addPage = () => {
        return (
            <div>
                <PageHeader className={"site-page-header"}>
                    <Input/>
                    <BraftEditor/>
                </PageHeader>
            </div>
        )
    }

    return (
        <BrowserRouter>
            <div style={{padding: "30px 20px"}}>
                {isAdd ? addPage() : casePage()}

                {/*<div style={{marginTop: "20px"}}>*/}
                {/*    {*/}
                {/*        <Card hoverable>*/}

                {/*        </Card>*/}
                {/*    }*/}
                {/*</div>*/}
            </div>
        </BrowserRouter>
    )
}

export default Case;
